import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  background-color: #eef3c0;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

const AvatarContainer = styled.div``;

const AvatarContainerColumn = styled.div``;

const AvatarImgContainer = styled.div`
  width: 145px;
  height: 145px;
  background-color: white;
  coerner
`;

const AvatarImg = styled.img``;

const AvatarDescription = styled.span`
  font-family: CoreGothicE-8;
  font-size: 16px;
  font-weight: 900;
  color: #000000;
`;

const AvatarInfo = styled.span``;

const DescriptionContentBlock = () => (
  <Container>
    <AvatarContainer>
      <AvatarContainerColumn>
        <AvatarImgContainer>
          <AvatarImg></AvatarImg>
        </AvatarImgContainer>
      </AvatarContainerColumn>
      <AvatarContainerColumn>
        <AvatarDescription>
          이제 인터넷 강의는 지긋지긋해요 <br />
          돈은 돈대로 쓰고 남는 건 없어요
        </AvatarDescription>
        <AvatarInfo></AvatarInfo>
      </AvatarContainerColumn>
    </AvatarContainer>
  </Container>
);
export default DescriptionContentBlock;
